public static WccData deserialize(XDR xdr) {
  xdr.readBoolean();
  WccAttr preOpAttr = WccAttr.deserialize(xdr);
  xdr.readBoolean();
  Nfs3FileAttributes postOpAttr = Nfs3FileAttributes.deserialize(xdr);
  return new WccData(preOpAttr, postOpAttr);
}
